One.onLoad(class {
    static initValidation() {
        One.helpers("jq-validation"), jQuery(".banka-ban-kaldir").validate({
            rules: {
                "banka_adi": {
                    required: !0,
                    minlength: 4
                }
            },
            messages: {
                "banka_adi": {
                    required: "Banını kaldırmak istediğin banka adını belirt.",
                    minlength: "Girmiş olduğunuz banka adı en az 4 karakter olmak zorundadır."
                }
            }
        })
    }
    static init() {
        this.initValidation()
    }
}.init());